import React from "react";

function Vocabulario() {
  return (
    <div>
      <h2>Vocabulario</h2>
      <p>¡Practica tus palabras en sueco y español!</p>
      {/* Puedes incluir tus tarjetas aquí */}
    </div>
  );
}

export default Vocabulario;
